import { View,
    Image,
    StyleSheet,
    TouchableOpacity,
    Text

} from 'react-native'
import React from 'react'

export default function DogPics() {
return (
<View>
<TouchableOpacity style={styles.card}>
<View style={styles.cardView}>
  <Image  style={styles.cardImage}
  
  source = {require('../assets/DogPics/Dog1.jpeg')}   />
  <Text style={styles.nameStyling}>Afghan Hound</Text>
      <Text style={styles.locationStyling}>Rawalpindi</Text>
      <Text style={styles.priceStyling}>Rs.4000/-</Text>
  </View>
  </TouchableOpacity>

  <TouchableOpacity style={styles.card}>
  <View style={styles.cardView}>
  <Image  style={styles.cardImage}
  
  source = {require('../assets/DogPics/Dog2.jpeg')}   />
  <Text style={styles.nameStyling}>Afghan Hound</Text>
      <Text style={styles.locationStyling}>Rawalpindi</Text>
      <Text style={styles.priceStyling}>Rs.4000/-</Text>
  </View>
  </TouchableOpacity>
  <TouchableOpacity style={styles.card}>
  <View style={styles.cardView}>
  <Image  style={styles.cardImage}
  
  source = {require('../assets/DogPics/Dog3.jpeg')}   />
  <Text style={styles.nameStyling}>Afghan Hound</Text>
      <Text style={styles.locationStyling}>Rawalpindi</Text>
      <Text style={styles.priceStyling}>Rs.4000/-</Text>
  </View>
  </TouchableOpacity>
  <TouchableOpacity style={styles.card}>
  <View style={styles.cardView}>
  <Image  style={styles.cardImage}
  
  source = {require('../assets/DogPics/Dog4.jpeg')}   />
  <Text style={styles.nameStyling}>German Shepherd</Text>
      <Text style={styles.germanLocation}>Rawalpindi</Text>
      <Text style={styles.priceStyling}>Rs.4000/-</Text>
  </View>
  </TouchableOpacity>
  <TouchableOpacity style={styles.card}>
  <View style={styles.cardView}>
  <Image  style={styles.cardImage}
  
  source = {require('../assets/DogPics/Dog5.jpeg')}   />
  <Text style={styles.nameStyling}>German Shepherd</Text>
      <Text style={styles.germanLocation}>Rawalpindi</Text>
      <Text style={styles.priceStyling}>Rs.4000/-</Text>
  </View>
  </TouchableOpacity>
 

</View>
)
}


var styles = StyleSheet.create({



    ImageStyling:{
        height:100,
        width:100,
        //margin:-10
       // marginLeft:-10,
        //marginRight:-10,
        resizeMode:'cover'
    } ,
    card:{
        backgroundColor:'#fff',
        marginBottom:10,
        marginLeft:'2%',
        width:"100%",
        shadowColor:'#000',
       /* shadowOpacity:1,
        shadowOffset:{
            height:3,
            width:3
        }*/

    },
    cardImage:{
        width:'50%',
        height:120,
        resizeMode:'cover',
        borderRadius:10
    },
    nameStyling:{
      marginLeft:10,
      marginTop:10,
      fontWeight:'bold',
      fontSize:23
      
    },
    locationStyling:{
      marginLeft:-130,
      marginTop:50,
      fontWeight:'bold',
      fontSize:20
      
    },
    priceStyling:{
      marginLeft:-80,
      marginTop:80,
      fontWeight:'bold',
      fontSize:20
    },
    cardView:{
      flexDirection:'row'
    },
    germanLocation:{
        marginLeft:-160,
      marginTop:50,
      fontWeight:'bold',
      fontSize:20
    }
    
    });
